import { useState } from "react";
import "./addtodiv.css";

export default function AddDivisions() {
  window.document.body.style.backgroundColor = "white";

  const [divisionsCount, setDivisionsCount] = useState(0);
  const [divisions, setDivisions] = useState([]);

  const handleConfirm = (e) => {
    e.preventDefault();
    // Generate input field rows based on divisionsCount
    const newDivisions = Array.from({ length: divisionsCount }, () => ({
      divisionName: "",
      noOfAdsts: 0,
      adsts: [],
    }));
    setDivisions(newDivisions);
  };

  const handleInputChange = (index, field, value) => {
    const updatedDivisions = [...divisions];
    updatedDivisions[index][field] = value;
    setDivisions(updatedDivisions);
  };

  const handleAdstInputChange = (divisionIndex, adstIndex, field, value) => {
    const updatedDivisions = [...divisions];
    updatedDivisions[divisionIndex].adsts[adstIndex][field] = value;
    setDivisions(updatedDivisions);
  };

  const handleAdstSubmit = (divisionIndex) => {
    const updatedDivisions = [...divisions];
    updatedDivisions[divisionIndex].adsts.push({
      role: "",
      password: "",
    });
    setDivisions(updatedDivisions);
  };

  const handleFinalSubmit = (e) => {
    e.preventDefault();
    console.log(divisions);
    // Perform any action with the divisions object
  };

  return (
    <>
      <div className="container addtodiv my-5">
        <form className="container formaddtodiv col-4" onSubmit={handleConfirm}>
          <label htmlFor="NumberofDivisions" className="form-label">
            Number of Divisions
          </label>
          <div className="mb-3 d-flex">
            <input
              type="number"
              className="form-control mx-3"
              id="NumberofDivisions"
              value={divisionsCount}
              onChange={(e) => setDivisionsCount(parseInt(e.target.value))}
            />
            <button type="submit" className="btn btn-primary">
              Confirm
            </button>
          </div>
        </form>
        {divisions.map((division, divisionIndex) => (
          <div key={divisionIndex} className="row mb-3">
            <div className="col-5 d-flex">
              <input
                type="text"
                className="form-control mx-2"
                value={division.divisionName}
                onChange={(e) =>
                  handleInputChange(divisionIndex, "divisionName", e.target.value)
                }
                placeholder="Division Name"
              />
              <input
                type="number"
                className="form-control mx-2"
                value={division.noOfAdsts}
                onChange={(e) =>
                  handleInputChange(divisionIndex, "noOfAdsts", parseInt(e.target.value))
                }
                placeholder="Number of Adsts"
              />
            </div>
            <div className="col-5 d-flex flex-column">
              {Array.from({ length: division.noOfAdsts }, (_, adstIndex) => (
                <div key={adstIndex} className="d-flex mb-2">
                  <input
                    type="text"
                    className="form-control"
                    value={division.adsts[adstIndex]?.role || ""}
                    onChange={(e) =>
                      handleAdstInputChange(
                        divisionIndex,
                        adstIndex,
                        "role",
                        e.target.value
                      )
                    }
                    placeholder="Role"
                  />
                  <input
                    type="password"
                    className="form-control mx-2"
                    value={division.adsts[adstIndex]?.password || ""}
                    onChange={(e) =>
                      handleAdstInputChange(
                        divisionIndex,
                        adstIndex,
                        "password",
                        e.target.value
                      )
                    }
                    placeholder="Password"
                  />
                </div>
              ))}
              <button
                className="btn btn-primary"
                onClick={() => handleAdstSubmit(divisionIndex)}
              >
                Add Number of Adsts
              </button>
            </div>
          </div>
        ))}
        {divisions.length > 0 && (
          <div className="text-center">
            <button type="submit" className="btn btn-primary" onClick={handleFinalSubmit}>
              Confirm All
            </button>
          </div>
        )}
      </div>
    </>
  );
}
